import './assset/less/public.less'

import Echarts from 'echarts'

const echarts = Echarts.init(document.getElementById('app'));

const { random,floor } = Math;

const moonSVG = 'image://data:image/gif;base64,'

const getRandomPoint = (num ,range = [[0,100],[60,100]]) => {
    const stars = [];
    for(let i=0; i<num; i++){
        stars.push([
            floor(random()*(range[0][1] - range[0][0])+range[0][0]),
            floor(random()*(range[1][1] - range[1][0])+range[1][0])
        ])
    }
    return stars;
}
const stars = {
    name: "stars",
    type: "scatter",
    symbol:'diamond',
    silent:true,
    color:'#fff',
    symbolSize:4,
    itemStyle:{
        shadowColor: '#fff',
        shadowBlur:5
    },
    z:5,
    data: getRandomPoint(20)
}
const lightSpot = {
    name: "lightSpot",
    type: "scatter",
    color:'orange',
    silent:true,
    symbolSize:20,
    itemStyle:{
        opacity: .3,
        shadowColor: 'orange',
        shadowBlur:10
    },
    z:5,
    data: getRandomPoint(5,[[0,100],[20,50]])
}
const moon = {
    name: "moon",
    type: "scatter",
    symbol:moonSVG,
    symbolSize:300,
    silent:true,
    itemStyle:{
        opacity: 1,
        shadowColor: '#fff',
        shadowBlur:10
    },
    label:{
        show:true,
        fontSize:30,
        formatter:'花好月圆'
    },
    data: [[50,50]]
}
echarts.setOption({
    grid: [{
        show:true,
        containLabel:true,
        // backgroundColor:,
        left:0,
        right:0,
        top:0,
        bottom:0,
        borderWidth:0
    }],
    xAxis:{
        show:false,
        min:0,
        max:100,
    },
    yAxis:{
        show:false,
        min:0,
        max:100,
    },
    series:[
        stars,
        lightSpot,
        moon
    ]
});